import React from "react";
import money from "../money";

function MoneyDisplay(props) {
  return ( 
    <div>
        { money.map(moneyImgs =>
            <div class="card">
         
            <div class="card-image">
                <img src={ process.env.PUBLIC_URL + props.image } />
            </div>
        </div>
        )}
    </div>
    )
};

export default MoneyDisplay;
